$(function(){if(window.top==window.self)return void(location.href="/404");const n=$("div.page-body-loading");window.lycoris=window.parent.lycoris.createLycoris(),window.lycoris.loading={show:()=>{n.addClass("loading")},hide:()=>{n.remove()}},window.lycoris.signalR={on:function(n,i){window.parent.lycoris.signalR.on(n,i)},unbind:function(n){window.parent.lycoris.signalR.unbind(n)},call:function(n,...i){window.parent.lycoris.signalR.call(n,...i)}}});